import React from "react";
import { styled } from "styled-components";

const Div = styled.div`
  background-color: #003580;
  width: 100%;
  height: 100%;

  & p {
    color: #fff;
    font-size: 20px;
  }
`;
export default function NavBar() {
  return (
    <Div>
      <p>Booking Website</p>
    </Div>
  );
}
